records.addlTxt:
Defendant Cassie M Edlebeck in court, in custody, with attorney J Anthony Rosario.   Melissa Zilavy appeared for the State of Wisconsin.

Plea Colloquy.

Defendant enters a guilty plea to Count 1.  Court finds defendant guilty.  Count 2 is dismissed and read in.

The Court Orders the Following:

Imposed and Stayed Sentence of:

3 Years 6 months Imprisonment (Credit - 84 days )
- 1 Year 6 months of Initial Confinement
- 2 Years of Extended Supervision

Term of Probation: 2 Years

Conditions of Probation:
- AODA Assessment and follow through with any treatment recommended;
- Mental Health Evaluation and follow through with any treatment recommended;
- Absolute Sobriety; Random U.A.s;
- No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Be involved in a 12 step program within first 2 weeks of probation and obtain a mentor/sponsor. Attend at least 1 meeting a week.
- Within first 60 days obtain a valid driver's license;
- Operate a motor vehicle with a valid driver's license;
- Maintain/Obtain full time employment;
- No contact with Walmart in Delafield and Pick N Save at Pabst Farms
- Provide DNA sample if not yet provided  and pay surcharge.

Restitution: $350.13 to Roundy's to be paid at the rate of $50.00 per month commencing 11-1-15.

Costs: $278.00 
DNA Surcharge:  $250.00
(To be paid as a condition of probation the rate of $50.00  per month commencing 9-1-15 and/or 53 hours of community service to be completed by the end of probation.  Failure to pay or complete community service the court orders 5 days Huber as a contempt.)

Defendant is eligible for the Challenge Incarceration Program
Defendant is eligible for the Substance Abuse Program

Felony warnings, immigration warnings,  voting rights and firearms warnings given.  

Defense requests expunction.  State objects. Expunction is conditionally granted upon completion of sentence, payment of all costs/fees/restitution and no new criminal convictions or pending cases.  Defendant must Petition the Court in writing upon successful completion of the sentence.
